const About = () => {
    return (
      <div className="max-w-4xl mx-auto mt-10 text-white px-4">
        <h1 className="text-3xl font-bold mb-6 text-black">About Us</h1>
  
        <p className="mb-6 text-black">
          Welcome to Inner Peace! Our mission is to promote holistic well-being through mindful products and practices that connect you to your true self. 
          Founded by a passionate yogi who believes in the healing power of yoga, meditation, and nature, our journey began with a simple goal: to create a space 
          where individuals can find peace, balance, and wellness in their daily lives.
        </p>
  
        <p className="mb-6 text-black">
          At Inner Peace, we offer a curated selection of high-quality yoga gear, self-care products, and resources for spiritual and physical well-being. Our founder, 
          who transformed their life through yoga and clean living, wanted to share this gift with others. With every product we offer, we aim to inspire peace, 
          mindfulness, and a deeper connection to the self.
        </p>
  
        <p className="text-black">
          Whether you're new to yoga or an experienced practitioner, we are here to support you on your journey to a more peaceful and balanced life. Thank you for being a part of our community.
        </p>
      </div>
    );
  };
  
  export default About;
